syntax = "proto3";

package bokura;

import "table_basic.proto";

message SeasonNodeTableBase {
    int32 Id = 1463;
    int32 HoleId = 820;
    int32 HoleLevel = 829;
    int_array NodeId = 1205;
    int32 NodeType = 1959;
    int32 SeasonId = 1669;
    int_table NodeCollection = 1126;
    int_table Collection = 977;
    int_table NumberConsume = 1835;
    int_table OtherConsume = 1176;
}

message SeasonNodeTableMgr {
    map<int32, .bokura.SeasonNodeTableBase> datas = 1;
}

